tables.Notes & Trivia:
-First televised 300 by a left-handed bowler;
-Second televised 300 game shot in a title match;
-Set record for combined score in a title match (579 total pins; Ozio shot 279)

-Second player with multiple televised PBA 300 games (the first was Rash) ;
-First PBA season with three televised 300 games;
-Rash: involved in the most televised 300 games combined (6 total: 2 for, 4 against)

-First televised PBA event with multiple 300 games;
-Fourth player with multiple televised PBA 300 games; 
-Fourth televised 300 game shot in a title match;
-Third televised 300 on a mixed oil pattern (left and right lanes had different lengths and layouts of oil) ;
-Longest gap between first and second televised 300 games (10 years)
